column61:
Governance activities this month included our monthly internal check-in meeting and other planning conversations and coordination regarding SOW development for the 2022-23 cycle.

Meetings included: 
Planning meeting with PAEA for 2022-23 cycle - 6/10; 
Planning meeting with internal stakeholders for 2022-23 SOW - 6/14;  
Internal check-in meeting - 6/14; 
CPGI bimonthly webinar - 6/14; 
Meeting/check-in with Engagement Counselor to share SOW ideas - 6/22.

We also worked on our 2021-22 end-of-cycle report and submitted it electronically on 6/28.

